import React from 'react'
import { NavLink } from 'react-router-dom'
import s from './Dialogs.module.css'

const DialogItem = (props) => {
  return(
    <div className={s.dialog + ' ' + s.active}> 
      <NavLink to={`/dialogs/${props.id}`}>{props.name}</NavLink>
    </div>
  )
}

const Message = (props) => {
  return(
    <div className={s.message}>{props.message}</div>
  )
}

const Dialogs = () => {

  let dialogsData = [
  {id: 1, name: 'Дима'},
  {id: 2, name: 'Маша'},
  {id: 3, name: 'Паша'},
  {id: 4, name: 'Кузя'},
  {id: 5, name: 'Туся'},
  {id: 6, name: 'Патриарх'}
  ]

  let dialogsElements = dialogsData.map(dialog => <DialogItem name={dialog.name} id={dialog.id}/>)

  let messagesData = [
    {id: 1, message: 'Hi'},
    {id: 2, message: 'Привет'},
    {id: 3, message: 'Hello'},
    {id: 4, message: 'Как дела?'},
    {id: 5, message: 'Whats app'}
    ]

  let messagesElements = messagesData.map(message => <Message message={message.message} id={message.id}/>)

  return (
    <div className={s.dialogs}>
      <div className={s.dialog__items}>
        <DialogItem id="1" name="Дима"/>
        <DialogItem id="2" name="Маша"/>
        <DialogItem id="3" name="Паша"/>
        <DialogItem id="4" name="Кузя"/>
        <DialogItem id="5" name="Туся"/>
        <DialogItem id="6" name="Патриарх"/>
      </div>
      <div className={s.messages}>
        <Message message="Hi"/>
        <Message message="Привет"/>
        <Message message="Hello"/>
      </div>
    </div>
  )
}

export default Dialogs
